import { ADD_TO_CART } from './cart'

const initialState = {}

const cartReducer = (state = initialState, action) => {
	switch (action.type) {
		case BUY_CAKE:
			return {
				...state,
				cartItems: state.push(action.payload)
			}
		default:
			return state
	}
}

export default cartReducer
